(72, 'tap_to_pay_iphone_q2_2023_no_wcpay', 'marketing', 'en_US', 'Accept in-person contactless payments on your iPhone', 'Tap to Pay on iPhone and WooCommerce Payments is quick, secure, and simple to set up â no extra terminals or card readers are needed. Accept contactless debit and credit cards, Apple Pay, and other NFC digital wallets in person.', '{}', 'pending', 'woocommerce.com', '2023-09-27 09:21:59', NULL, 0, 'plain', '', 0, 0, 'info'),
(73, 'woocommerce-WCSubscriptions-June-2023-updated-needed', 'marketing', 'en_US', 'Action required: Security update of WooCommerce Subscriptions', '<strong>Your store requires a security update for the WooCommerce Subscriptions plugin</strong>. Please update the WooCommerce Subscriptions plugin immediately to address a potential vulnerability.', '{}', 'pending', 'woocommerce.com', '2023-09-27 09:21:59', NULL, 0, 'plain', '', 0, 0, 'info'),
(74, 'wc_admin_BNPL_WCPay_Q3_2023', 'marketing', 'en_US', 'Afterpay and Affirm have arrived in WooCommerce Payments!', 'Give your customers more power with buy now, pay later from Afterpay and Affirm â now included as part of WooCommerce Payments! With this new integration, you can quickly offer a checkout option that converts sales and boosts average order value, all from within the same payments dashboard you already know.', '{}', 'pending', 'woocommerce.com', '2023-09-27 09:21:59', NULL, 0, 'plain', '', 0, 0, 'info'),
(75, 'wc_admin_afterpay_WCPay_Q3_2023', 'marketing', 'en_US', 'Afterpay has arrived in WooCommerce Payments!', 'Give your customers more power with buy now, pay later from Afterpay â now included as part of WooCommerce Payments! With this new integration, you can quickly offer a checkout option that converts sales and boosts average order value, all from within the same payments dashboard you already know.', '{}', 'pending', 'woocommerce.com', '2023-09-27 09:21:59', NULL, 0, 'plain', '', 0, 0, 'info'),
(76, 'avalara_q3-2023_noAvaTax', 'marketing', 'en_US', 'Automatically calculate VAT in real time', 'Take the effort out of determining tax rates and sell confidently across borders with automated tax management from Avalara AvaTaxâ including built-in VAT calculation when you sell into or across the EU and UK. Save time and stay compliant when you let Avalara do the heavy lifting.', '{}', 'pending', 'woocommerce.com', '2023-09-27 09:21:59', NULL, 0, 'plain', '', 0, 0, 'info'),
(77, 'wc-admin-customizing-product-catalog', 'info', 'en_US', 'How to customize your product catalog', 'You want your product catalog and images to look great and align with your brand. This guide will give you all the tips you need to get your products looking great in your store.', '{}', 'unactioned', 'woocommerce-admin', '2023-09-30 08:43:13', NULL, 0, 'plain', '', 0, 1, 'info'),
(78, 'wc-admin-launch-checklist', 'info', 'en_US', 'Ready to launch your store?', 'To make sure you never get that sinking \"what did I forget\" feeling, we\'ve put together the essential pre-launch checklist.', '{}', 'unactioned', 'woocommerce-admin', '2023-09-30 08:43:13', NULL, 0, 'plain', '', 0, 1, 'info'),
(79, 'wc-admin-usage-tracking-opt-in', 'info', 'en_US', 'Help WooCommerce improve with usage tracking', 'Gathering usage data allows us to improve WooCommerce. Your store will be considered as we evaluate new features, judge the quality of an update, or determine if an improvement makes sense. You can always visit the <a href=\"http://localhost/woocommerce/wp-admin/admin.php?page=wc-settings&#038;tab=advanced&#038;section=woocommerce_com\" target=\"_blank\">Settings</a> and choose to stop sharing data. <a href=\"https://woocommerce.com/usage-tracking?utm_medium=product\" target=\"_blank\">Read more</a> about what data we collect.', '{}', 'unactioned', 'woocommerce-admin', '2023-10-02 09:21:42', NULL, 0, 'plain', '', 0, 1, 'info'),
(80, 'wc-admin-orders-milestone', 'info', 'en_US', 'First order received', 'Congratulations on getting your first order! Now is a great time to learn how to manage your orders.', '{\"current_milestone\":1}', 'unactioned', 'woocommerce-admin', '2023-10-09 08:21:24', NULL, 0, 'plain', '', 0, 0, 'info');
